    <section class="_col Tea">
      <div class="_col-title"></div>
      <div class="_col-content _flex _flex_reverse">
        <div class="_col-img _col-item" style="visibility: inherit; opacity: 1;">
          <div class="_img-bg"
               style="background-image: url('/static/images/tea-leaves.jpg'); visibility: inherit; opacity: 0.6; transform: matrix(1.3, 0, 0, 1.3, 40, 0);"></div>
        </div>
        <div class="_col-copy _col-item _flex_v_h_r" style="visibility: inherit; opacity: 1;">
          <div class="_wrapper"><h1>Tea</h1>
            <p>Our tea leaves are sourced in Indonesia then brewed to perfection using the best tea leaves, the right
              process and finest technology. Our Tea Extract provides the essential top note and most sort after tea
              flavour, resembling that of freshly brewed tea. Finally it's spray dried then delivered fresh to New
              Zealand.</p></div>
        </div>
      </div>
    </section>
    <section class="_col Extracts">
      <div class="_col-title"></div>
      <div class="_col-content _flex _flex_">
        <div class="_col-img _col-item" style="visibility: inherit; opacity: 1;">
          <div class="_img-bg"
               style="background-image: url('/static/images/peach-fruit.jpg'); visibility: inherit; opacity: 0.6; transform: matrix(1.3, 0, 0, 1.3, -40, 0);"></div>
        </div>
        <div class="_col-copy _col-item _flex_v_h_r" style="visibility: inherit; opacity: 1;">
          <div class="_wrapper"><h1>Extracts</h1>
            <p>Our flavours are strictly tested and scrutinized to make sure we have only the best tasting beverages. We
              use extracts instead of artificial flavours as we believe in keeping things as natural as possible -
              leaving you feeling good about drinking our Nectar.</p></div>
        </div>
      </div>
    </section>
    <section class="_col Brew">
      <div class="_col-title"></div>
      <div class="_col-content _flex _flex_reverse">
        <div class="_col-img _col-item" style="visibility: inherit; opacity: 1;">
          <div class="_img-bg"
               style="background-image: url('/static/images/nectar-jug.jpg'); visibility: inherit; opacity: 0.6; transform: matrix(1.3, 0, 0, 1.3, 40, 0);"></div>
        </div>
        <div class="_col-copy _col-item _flex_v_h_r" style="visibility: inherit; opacity: 1;">
          <div class="_wrapper"><h1>Brew</h1>
            <p>We blend all of our beverages locally - keeping all of our work close to home. This ensures Nectar is
              fresh for when you get your hands on a bottle.</p></div>
        </div>
      </div>
    </section>
