<script>
  /* eslint-disable camelcase,one-var,no-unused-vars */
  import $ from 'jquery'
  import ScrollMagic from 'scrollmagic'
  import {TweenMax, Power4, TimelineMax} from 'gsap'
  import 'ScrollMagicGSAP'
  export default {
    name: 'About',
    metaInfo: {
      title: 'Nectar\'s Fresh, Natural and NZ made Beverages',
      meta: [
        {
          name: 'description',
          content: 'The team at Nectar is committed to delivering quality, natural and superb tasting beverages. We have pride in what we\'ve created here and are convinced that our Tea based beverages are the best in market.'
        }
      ]
    },
    data: () => {
      return {
        parallex: {
          tea: {
            class: '.Tea ._col-img',
            duration: window.innerHeight,
            offset: -50,
            tween: (e) => {
              return TweenMax.fromTo(e, 1,
                {
                  x: 40,
                  autoAlpha: 0.6,
                  scale: 1.3
                },
                {
                  x: 0,
                  scale: 1,
                  autoAlpha: 1
                })
            }
          },

          peach: {
            class: '.Extracts ._col-img',
            duration: window.innerHeight,
            offset: -50,
            tween: (e) => {
              return TweenMax.fromTo(e, 1,
                {
                  x: -40,
                  autoAlpha: 0.6,
                  scale: 1.3
                },
                {
                  ease: Power4.easeOut,
                  x: 0,
                  scale: 1,
                  autoAlpha: 1
                })
            }
          },
          Brew: {
            class: '.Brew ._col-img',
            duration: window.innerHeight,
            offset: -50,
            tween: (e) => {
              return TweenMax.fromTo(e, 1,
                {
                  x: 40,
                  autoAlpha: 0.6,
                  scale: 1.3
                },
                {
                  x: 0,
                  scale: 1,
                  autoAlpha: 1
                })
            }
          },
          bottle: {
            class: '.Bottle ._col-img',
            duration: window.innerHeight,
            offset: -50,
            tween: (e) => {
              return TweenMax.fromTo(e, 1,
                {
                  x: -e.outerHeight() / 1.3,
                  autoAlpha: 0
                },
                {
                  x: 0,
                  autoAlpha: 0.5
                })
            }
          },
          nectar: {
            class: '.Nectar ._col-img',
            // alt_point: device.port() ? false : '.Bottle',
            duration: window.innerHeight,
            // offset: 0,
            offset: -window.innerHeight / 2,
            tween: (e) => {
              return new TimelineMax()
                .fromTo(e, 1,
                  {
                    y: (e.outerHeight() / 3),
                    autoAlpha: 0
                  },
                  {
                    y: -(e.outerHeight() / 3),
                    autoAlpha: 1
                  })
            }
          }
        }
      }
    },
    mounted () {
      this.show_label_animation()
      this.build_all_scroll_magic(this.parallex)
      $(window).on('orientationchange', () => {
        TweenMax.delayedCall(0.5, (parallex) => {
          this.build_all_scroll_magic(parallex)
        }, [this.parallex], this)
      })
    },
    methods: {
      random: function (min, max) {
        return Math.floor(Math.random() * (max - min + 1)) + min
      },
      show_label_animation () {
        let $elm = $('.-svg-label-f'),
          $col_items = $('._col-item'),
          $svg_objs = $elm.find('path:not(.not), rect, polygon, circle, text'),
          dur = 1.2,
          $array = $svg_objs.toArray(),
          t_l = new TimelineMax({delay: .5})

        let $this = this

        t_l.fromTo($elm, 1, {y: -100}, {y: 0, autoAlpha: 1}, 'a')

        $array.splice(($array.length / 2) - 3, $array.length).forEach(($e) => {
          t_l.add(TweenMax.from($e, dur * 2,
            {
              y: $this.random(-100, 100),
              x: $this.random(-100, 100),
              scale: $this.random(),
              rotation: $this.random(-360, 360),
              z: $this.random(-100, 100),
              autoAlpha: 0
            }), -(dur / 2))
        })
        t_l.add(TweenMax.staggerTo($($col_items.toArray().reverse()), 0.3, {autoAlpha: 1}, -0.15), '-=0.1')
      },
      build_all_scroll_magic: (items) => {
        if (items.controller) {
          items.controller.destroy(true)
        }
        items.controller = new ScrollMagic.Controller()
        for (var item in items) {
          if (item === 'controller') continue
          let i = items[item]
          if (i.scroll_magic) {
            i.scroll_magic.destroy(true)
          }
          i.scroll_magic = new ScrollMagic.Scene({
            triggerElement: i.alt_point || i.class,
            duration: i.duration,
            offset: i.offset
          })
            .setTween(i.tween($(i.class + ' ._img-bg')))
            .addTo(items.controller)
        }
      }
    }
  }
